//Fecha de Ingreso
var fecha = new GlideDateTime(current.variables.u_slx_fecha_encuesta);
var hoy= new GlideDateTime();


var dur = GlideDateTime.subtract(hoy, fecha); //se obtiene la diferencia entre hoy y el ingreso

var tiempo= dur.getNumericValue() / 1000; //se obtiene el valor en segundo

answer= tiempo; //se retorna la cantidad de segundos a esperar

